import "./../node_modules/video-react/dist/video-react.css"
import React from 'react'
import { Container, Card, Title, Img, Video, Button } from './styles/app.styles'
import video from "./assets/video/video1.mp4"
import image from "./assets/image/flyer.jpg"

function App() {
  return (
    < Container >

      <Title> Seja Bem Vindo!, Abra o video e mude sua vida! </Title>
      <Card alignItems="center">
        <Video className="myvideo" src={video} controls autoPlay muted />
        <Img src={image} />
      </Card>

    </Container >
  );
}

export default App;
